#Formula1 CEO'su Stefano Domenicali;

🏁Sezonlardaki yarış sayısının artabileceğini hatta 30'a kadar çıkabileceğini,

🏁Formula 1'e dahil olmak isteyen 4-5 takım talebi olduğunu söyledi.

Rus ordusunun kontrolüne geçen Çernobil Nükleer Enerji Santrali ile ilgili Ukraynalı bir yetkili; 

📌Bölgede çok ciddi enerji krizi olduğunu ve Çernobil'in radyasyon sızıntısı yapabileceğini söyledi. 

📌Sızıntı durumunda 2011'deki Fukuşima Nükleer Santrali kazası tekrarlanacak.

